import * as types from '../Actions/actionTypes'

const editedmode = (boolean) =>({
    type: types.EDITMODE,
    payload:boolean
})

export const editedmodeInitiate = ( bl ) =>{
    return function(dispatch){
        dispatch(editedmode(bl))
    }
}
